import React from "react";
import { Jumbotron, Button, Image, Container, Row, Col } from "react-bootstrap";
import "./style.css";

const Hero = (props) => (
  <Container className="hero">
    <Row>
      <Col>
        <h1>Hi, I'm Amy!<br/>
          I’m an L.A. girl with big dreams – I’m discovering mine studying
          at Stanford.<br />
          I pride myself on bringing ethics and a deep love of research to the drawing board. For every pixel I push, I want to know how it’ll change people’s behavior, decisions, and minds. 
        </h1>
        <Button className="custom-btn" href={props.ButtonLink}>
          Meet with me
        </Button>
      </Col>
    </Row>
  </Container>
);

export default Hero;
